    <script>const OPENED_MESSAGE = 'CIRCLET_AUTH_PAGE_OPENED';

function postMessage(data) {
  const target = window.opener || window.parent;
  if (!target || target === window) {
    return;
  }

  try {
    target.postMessage(data, '*');
  } catch (err) {
    console.error('Failed to inform parent window', err);
  }
}

postMessage(OPENED_MESSAGE);</script>
